import React from "react";
import "./centreelement.scss";

function Centreelement() {
  return (
    <div className="center-container">
      <div className="center-container__heading">Project</div>
      <div className="center-container__buttons">
        <div className="center-container__filter-btn">
          <button>Filter</button>
        </div>
        <div className="center-container__create-btn">
          <button>+create New</button>
        </div>
      </div>
    </div>
  );
}

export default Centreelement;
